import React from 'react'
import axios from 'axios';
import CategoryTable from './CategoryTable.js'

class CarsProperty extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            loading: false,
            error: null,
            carsPropertyHeader:[],
            carsPropertyItem: [],
            category: "Cars & Property",
            fetch : "http://desmond.business:8080/fyp/getCategoryFirstLvs"
        }
    }

    componentDidMount(){
        axios.get("http://desmond.business:8080/fyp/getCategoryFirstLvs")
        .then(res => {
            // Transform the raw data by extracting the nested posts

            const posts = res.data.results;
            //console.log(posts);
            // Update state to trigger a re-render.
            // Clear any errors, and turn off the loading indiciator.
            posts.forEach((elm) => {
                if(elm.category_first_lv_name == this.state.category){
                    console.log(elm)
                this.state.carsPropertyHeader.push(elm.theCategorySecondLvs.map((obj, index) =>
                    <th key={obj.id}>
                       {obj.category_second_lv_name}
                    </th>
                    ))
                }
            })

            console.log(this.state.carsProperty)
            this.setState({
                loading: false,
                error: null
            });
        })
        .catch(err => {
            // Something went wrong. Save the error in state and re-render.
            this.setState({
                loading: false,
                error: err
            });
        })
    }

    render() {
        return (
            <CategoryTable data={this.state.data}></CategoryTable>
        )
    }
}

export default CarsProperty;
